INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES (1, 5, 107011, "", "ただ、そうですね……\n厚意に預かるばかり、\nというのも性に合いませんし。\n何かご褒美をあげましょう。", 1070501046, 0, 1070501, 11, 1, 0);
